import { useHistory } from 'react-router';
import LoginForm from '../../login-form'

import './modalAuthorized.css';

const ModalAuthorized = ({ cl, setModal }) => {
    const ref = useRef()
    let clazz = cl;
    //history.push('/login')
    const history = useHistory()

    return (
        <div className={`modal-liked ${clazz}`} ref={ref}>
            <div className='header-modal-liked'>
                <p className='modal-liked-title'>Do u like post?</p>
                <button className='close-modal-like' onClick={() => setModal('hidden')}>X</button>
            </div>
            <p className='login-first'>login first</p>
            <hr />
            <button className='login-modal-liked' onClick={() => <LoginForm />}>Sign in</button>
        </div>
    )
}

export default ModalAuthorized;
